import React, { useState } from "react";
import InputField from '../components/InputField';
import ToggleButton from "../components/ToggleButton";

export default function IndexPage() {
  return (
    <div className="h-screen w-screen bg-white flex items-center justify-center">
      <div className="space-y-5">
        <InputField type="text" label="Email" error="This email is invalid."/>
        <InputField type="text" label="Username" error="This username is already taken."/>
        <InputField type="password" label="Password" error="Your password must be more than 5 characters."/>
      </div>
    </div>
  );
}
